import React from "react";
import {Link} from 'react-router-dom';
import {Navbar, Nav, Container} from 'react-bootstrap';
import {ReactSession} from 'react-client-session';

const NavBar = () => {
    console.log(JSON.stringify(sessionStorage.getItem('user')))
    return(
        <Navbar bg="light" expand="lg" style={{marginBottom: "80px"}}>
        <Container>
            <Navbar.Brand href="#home">Przepisy i tu tego</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
                <Link className="nav-link" to="/">Home</Link>
                <Link className="nav-link" to="/recipie/add">Add recipie</Link>
            </Nav>
            <Nav className="justify-content-end">
            {/* {ReactSession.getItem('user') != null ? <p>logged in</p> : <p>logged out</p>}
            {ReactSession.getItem('user')} */}
            <Link className="nav-link" to="/login">Login</Link>
            </Nav>
            </Navbar.Collapse>
        </Container>
        </Navbar>
    );
}

export default NavBar;
